import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const Sidebar = ({ onCollapsedChange }) => {
  const [activeSection, setActiveSection] = useState('home');
  const [isCollapsed, setIsCollapsed] = useState(() => {
    const saved = localStorage.getItem('sidebarCollapsed');
    return saved ? JSON.parse(saved) : false;
  });

  // Save collapsed state to localStorage
  useEffect(() => {
    localStorage.setItem('sidebarCollapsed', JSON.stringify(isCollapsed));
    onCollapsedChange?.(isCollapsed);
  }, [isCollapsed, onCollapsedChange]);

  useEffect(() => {
    const handleScroll = () => {
      const sections = ['home', 'about', 'projects', 'timeline'];
      const current = sections.find(section => {
        const element = document.querySelector(`#${section}`);
        if (element) {
          const rect = element.getBoundingClientRect();
          return rect.top <= 150 && rect.bottom >= 150;
        }
        return false;
      });
      if (current) setActiveSection(current);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);



  return (
    <>
      <motion.button
        onClick={() => setIsCollapsed(!isCollapsed)}
        className="fixed top-4 left-4 z-50 p-2 bg-white rounded-full shadow-lg hover:bg-gray-100"
        whileHover={{ scale: 1.1 }}
        whileTap={{ scale: 0.9 }}
      >
        <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d={isCollapsed ? 'M4 6h16M4 12h16M4 18h16' : 'M6 18L18 6M6 6l12 12'} />
        </svg>
      </motion.button>

      <motion.aside
        initial={{ x: 0 }}
        animate={{ x: isCollapsed ? '-100%' : 0 }}
        transition={{ duration: 0.3, ease: 'easeInOut' }}
        className="fixed top-0 left-0 h-screen w-64 bg-white shadow-lg z-40 transition-transform duration-300 ease-in-out overflow-y-auto"
      >
      <div className="p-6 h-full flex flex-col min-h-screen">
        {/* Profile Section */}
        <div className="text-center mb-8">
          <div 
            className="w-32 h-32 mx-auto rounded-full bg-cover bg-center mb-4" 
            style={{backgroundImage: 'url(images/about.jpg)'}}
          />
          <h1 className="text-2xl font-bold mb-2">Hazel Grace Flores</h1>
          <div className="flex items-center justify-center gap-2 text-gray-600">
            <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 8l7.89 5.26a2 2 0 002.22 0L21 8M5 19h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z" />
            </svg>
            <span>floreshazelgrace@gmail.com</span>
          </div>
        </div>

        {/* Navigation */}
        <nav className="flex-1">
          <ul className="space-y-4 text-center">
            {[
              { id: 'home', label: 'INTRODUCTION' },
              { id: 'about', label: 'ABOUT' },
              { id: 'projects', label: 'PROJECTS' },
              { id: 'timeline', label: 'TIMELINE' }
            ].map(item => (
              <li key={item.id}>
                <a
                  href={`#${item.id}`}
                  onClick={() => setActiveSection(item.id)}
                  className={`block py-2 transition-colors duration-200 ${activeSection === item.id ? 'text-blue-500' : 'text-gray-600 hover:text-blue-500'}`}
                >
                  {item.label}
                </a>
              </li>
            ))}
          </ul>
        </nav>

        {/* Social Links */}
        <div className="mt-auto pt-6 flex justify-center space-x-4">
          {[
            { href: 'https://www.facebook.com/heyyzl', icon: 'facebook', color: '#1877f2' },
            { href: 'https://twitter.com/heyyzl_', icon: 'twitter', color: '#1da1f2' },
            { href: 'https://www.instagram.com/heyyzl_', icon: 'instagram', color: '#e4405f' },
            { href: 'https://www.linkedin.com/in/hazel-grace-flores/', icon: 'linkedin', color: '#0077b5' },
            { href: 'https://github.com/hzlgrce', icon: 'github', color: '#333' }
          ].map((social, index) => (
            <motion.a
              key={index}
              href={social.href}
              target="_blank"
              rel="noopener noreferrer"
              className={`text-[${social.color}] hover:opacity-80 transition-opacity duration-200`}
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.95 }}
            >
              <i className={`fab fa-${social.icon} text-xl`}></i>
            </motion.a>
          ))}
        </div>
      </div>
    </motion.aside>
    </>
  );
};

export default Sidebar;
